import Profile from './components/Profile';

const Example = () => {
  const profile = [{ name: 'Geo', age: 18, hobbies: { a: 'sports' } }];
  return (
    <>
      <ul>
        <Profile />
      </ul>
    </>
  );
};

export default Example;
